            $account = $accounts[0];
            $this->account_id = $account->getAccountId();
        }

        $this->authenticated = true;

        return $this;
    }

    /**
     * Get JWT auth by RSA key
     */
    public function login()
    {
        $this->client->getOAuth()->setOAuthBasePath($this->auth_server);

        try {
            $response =  $this->client->requestJWTUserToken(
                $this->integrator_key,
                $this->impersonated_user_id,
                $this->private_key,
                $this->jwt_scope,
                $this->jwt_expiry,
            );
        } catch (\Throwable $th) {
            throw $th;
        }

        $access_token = $response[0]->getAccessToken();

        return $this->client->getUserInfo($access_token)[0]->getAccounts();
    }

    /**
     * @param string $account_id
     * @return $this
     */
    public function setAccountId(string $account_id)
    {
        $this->account_id = $account_id;

        return $this;
    }

    /**
     * @return bool
     */
    public function isAuthenticated(): bool
    {
        return $this->authenticated;
    }

    /**
     * @return string
     * @throws \DocuSign\eSign\Client\ApiException
     */
    public function getAccountId(): string
    {
        if ($this->account_id === null) {
            $this->authenticate();
        }

        return $this->account_id;
    }

    /**
     * @return ApiClient
     */
    public function getClient(): ApiClient
    {
        if ($this->client) {
            return $this->client;
        }

        return $this->client = new ApiClient($this->getConfiguration());
    }
}
